import React, { Component } from "react";
import SingleCard from "./SingleCard";
export class Card extends Component {
  render() {
    return (
      <div>
        <h1></h1>
        <div class="row text-center">
          <SingleCard />
          <SingleCard />
          <SingleCard />
        </div>
      </div>
    );
  }
}

export default Card;
